import {FaShoppingCart} from "react-icons/fa"
import { NavLink } from "react-router-dom";

const Navbar = () => {
  return (
    <div>
      <div className="flex flex-row justify-between">
        <NavLink to="/">
          <div>
            <img src="" alt="logo" />
          </div>
          </NavLink>
          <div>
            <p>Home</p>

            <div>
                <FaShoppingCart/>
            </div>
          </div>
      </div>
    </div>
  );
};

export default Navbar;
